definition:
A Feigned story or tale, intended to instruct or amuse; a
   fictitious narration intended to enforce some useful truth or precept;
   an apologue. See the Note under Apologue.

The act of fabricating, framing, or constructing;
   construction; manufacture; as, the fabrication of a bridge, a church,
   or a government.

Feigned, as a story or fable; related in fable; devised;
   invented; not real; fictitious; as, a fabulous description; a fabulous
   hero.

Pertaining to faction; proceeding from faction;
   indicating, or characterized by, faction; -- said of acts or
   expressions; as, factious quarrels.

Ability to act or perform, whether inborn or cultivated;
   capacity for any natural function; especially, an original mental power
   or capacity for any of the well-known classes of mental activity;
   psychical or soul capacity; capacity for any of the leading kinds of
   soul activity, as knowledge, feeling, volition; intellectual endowment
   or gift; power; as, faculties of the mind or the soul.

A failing short; a becoming deficient; failure;
   deficiency; imperfection; weakness; lapse; fault; infirmity; as, a
   mental failing.

Performed, done, or acted, in a weak or feeble manner;
   not exhibiting vigor, strength, or energy; slight; as, faint efforts;
   faint resistance.

Not overcast; cloudless; clear; pleasant; propitious;
   favorable; -- said of the sky, weather, or wind, etc.; as, a fair sky;
   a fair day.

Free from obstacles or hindrances; unobstructed;
   unincumbered; open; direct; -- said of a road, passage, etc.; as, a
   fair mark; in fair sight; a fair view.

Without sudden change of direction or curvature; smooth;
   fowing; -- said of the figure of a vessel, and of surfaces, water
   lines, and other lines.

Not true to allegiance, duty, or vows; perfidious;
   trecherous; disloyal; not of true fidelity; inconstant, as a husband or
   a wife.

To Descend, either suddenly or gradually; particularly, to
   descend by the force of gravity; to drop; to sink; as, the apple falls;
   the tide falls; the mercury falls in the barometer.

To descend in character or reputation; to become degraded;
   to sink into vice, error, or sin; to depart from the faith; to
   apostatize; to sin.

To pass somewhat suddenly, and passively, into a new state
   of body or mind; to become; as, to fall asleep; to fall into a passion;
   to fall in love; to fall into temptation.

Downfall; degradation; loss of greatness or office;
   termination of greatness, power, or dominion; ruin; overthrow; as, the
   fall of the Roman empire.

Not genuine or real; assumed or designed to deceive;
   counterfeit; hypocritical; as, false tears; false modesty; false
   colors; false jewelry.

The state of being false; contrariety to the fact;
   inaccuracy; want of integrity or uprightness; double dealing;
   unfaithfulness; treachery; perfidy; as, the falseness of a report, a
   drawing, or a singer's notes; the falseness of a man, or of his word.

A curved fold or process of the dura mater or the peritoneum;
   esp., one of the partitionlike folds of the dura mater which extend
   into the great fissures of the brain.

Closely acquainted or intimate, as a friend or companion;
   well versed in, as any subject of study; as, familiar with the
   Scriptures.

That which produces effects analogous to those of a fan, as in
   exciting a flame, etc.; that which inflames, heightens, or strengthens;
   as, it served as a fan to the flame of his passion.

Conceived in the fancy; not consistent with facts or
   reason; abounding in ideal qualities or figures; as, a fanciful scheme;
   a fanciful theory.

A flourish of trumpets, as in coming into the lists, etc.;
   also, a short and lively air performed on hunting horns during the
   chase.

The price of passage or going; the sum paid or due for
   conveying a person by land or water; as, the fare for crossing a river;
   the fare in a coach or by railway.

The prevailing mode or style, especially of dress; custom
   or conventional usage in respect of dress, behavior, etiquette, etc.;
   particularly, the mode or style usual among persons of good breeding;
   as, to dress, dance, sing, ride, etc., in the fashion.

Established or favored by custom or use; current;
   prevailing at a particular time; as, the fashionable philosophy;
   fashionable opinions.

Of a character which enables the compositor to make large
   wages; -- said of matter containing blank, cuts, or many leads, etc.;
   as, a fat take; a fat page.

Causing death or destruction; deadly; mortal; destructive;
   calamitous; as, a fatal wound; a fatal disease; a fatal day; a fatal
   error.

The state of being fatal, or proceeding from destiny;
   invincible necessity, superior to, and independent of, free and
   rational control.

A fixed decree by which the order of things is prescribed;
   the immutable law of the universe; inevitable necessity; the force by
   which all existence is determined and conditioned.

A male ancestor more remote than a parent; a progenitor;
   especially, a first ancestor; a founder of a race or family; -- in the
   plural, fathers, ancestors.

One of the chief esslesiastical authorities of the first
   centuries after Christ; -- often spoken of collectively as the Fathers;
   as, the Latin, Greek, or apostolic Fathers.

Pertaining to the fauces, or opening of the throat;
   faucial; esp., (Phon.) produced in the fauces, as certain deep guttural
   sounds found in the Semitic and some other languages.

To interrupt the continuity of (rock strata) by
   displacement along a plane of fracture; -- chiefly used in the p. p.;
   as, the coal beds are badly faulted.

The act of countenancing, or the condition of being
   countenanced, or regarded propitiously; support; promotion;
   befriending.

A painful emotion or passion excited by the expectation of
   evil, or the apprehension of impending danger; apprehension; anxiety;
   solicitude; alarm; dread.

The quality or power of producing fruit; fruitfulness;
   especially (Biol.), the quality in female organisms of reproducing
   rapidly and in great numbers.

One of the sense organs or certain animals (as insects),
   which are used in testing objects by touch and in searching for food;
   an antenna; a palp.

Characterized by felicity; happy; prosperous;
   delightful; skilful; successful; happily applied or expressed;
   appropriate.

Having the quality of felony; malignant; malicious;
   villainous; traitorous; perfidious; in a legal sense, done with intent
   to commit a crime; as, felonious homicide.

Any one of those words which are the appellations of
   females, or which have the terminations usually found in such words;
   as, actress, songstress, abbess, executrix.

Low land overflowed, or covered wholly or partially with
   water, but producing sedge, coarse grasses, or other aquatic plants;
   boggy land; moor; marsh.

Producing fruit or vegetation in abundance; fruitful; able
   to produce abundantly; prolific; fecund; productive; rich; inventive;
   as, fertile land or fields; a fertile mind or imagination.

To make fertile or enrich; to supply with nourishment
   for plants; to make fruitful or productive; as, to fertilize land,
   soil, ground, and meadows.

To bring to accomplishment; to achieve; to make; to
   perform, with certain objects; as, to fetch a compass; to fetch a leap;
   to fetch a sigh.

The young or embryo of an animal in the womb, or in the egg;
   often restricted to the later stages in the development of viviparous
   and oviparous animals, embryo being applied to the earlier stages.

Not many; small, limited, or confined in number; --
   indicating a small portion of units or individuals constituing a whole;
   often, by ellipsis of a noun, a few people.

Not fixed or firm; liable to change; unstable; of a
   changeable mind; not firm in opinion or purpose; inconstant;
   capricious; as, Fortune's fickle wheel.

Florid; figurative; involving passing discords by the
   freer melodic movement of one or more parts or voices in the harmony;
   as, figurate counterpoint or descant.

A very small figure, whether human or of an animal;
   especially, one in terra cotta or the like; -- distinguished from
   statuette, which is applied to small figures in bronze, marble, etc.

To take the ffirst steps or measures in erecting or
   building up; to furnish the materials for beginning; to begin to raise;
   to originate; as, to found a college; to found a family.

Finished; brought to perfection; refined; hence, free
   from impurity; excellent; superior; elegant; worthy of admiration;
   accomplished; beautiful.

The knot or bunch of foliage, or foliated ornament, that
   forms the upper extremity of a pinnacle in Gothic architecture;
   sometimes, the pinnacle itself.

Having a limit; limited in quantity, degree, or capacity;
   bounded; -- opposed to infinite; as, finite number; finite existence; a
   finite being; a finite mind; finite duration.

Fixed; hence, closely compressed; compact; substantial;
   hard; solid; -- applied to the matter of bodies; as, firm flesh; firm
   muscles, firm wood.

A mood of any kind which masters or possesses one for a time;
   a temporary, absorbing affection; a paroxysm; as, a fit melancholy, of
   passion, or of laughter.

To make firm, stable, or fast; to set or place permanently;
   to fasten immovably; to establish; to implant; to secure; to make
   definite.

Yielding to pressure for want of firmness and stiffness;
   soft and weak; limber; lax; drooping; flabby; as, a flaccid muscle;
   flaccid flesh.

Lying at full length, or spread out, upon the ground;
   level with the ground or earth; prostrate; as, to lie flat on the
   ground; hence, fallen; laid low; ruined; destroyed.

A level surface, without elevation, relief, or prominences;
   an extended plain; specifically, in the United States, a level tract
   along the along the banks of a river; as, the Mohawk Flats.

Animal food, in distinction from vegetable; meat;
   especially, the body of beasts and birds used as food, as distinguished
   from fish.

The state or quality of being flexible; flexibleness;
   pliancy; pliability; as, the flexibility of strips of hemlock, hickory,
   whalebone or metal, or of rays of light.

To cast, send, to throw from the hand; to hurl; to dart;
   to emit with violence as if thrown from the hand; as, to fing a stone
   into the pond.

To throw with a jerk or quick effort; to fling suddenly;
   as, they flirt water in each other's faces; he flirted a glove, or a
   handkerchief.

Something made or performed in a fanciful, wanton, or
   vaunting manner, by way of ostentation, to excite admiration, etc.;
   ostentatious embellishment; ambitious copiousness or amplification;
   parade of words and figures; show; as, a flourish of rhetoric or of
   wit.

A fantastic or decorative musical passage; a strain of
   triumph or bravado, not forming part of a regular musical composition;
   a cal; a fanfare.

To glide along smoothly, without harshness or asperties;
   as, a flowing period; flowing numbers; to sound smoothly to the ear; to
   be uttered easily.

One of the membranous intervals between the incompleted
   angles of the parietal and neighboring bones of a fetal or young skull;
   -- so called because it exhibits a rhythmical pulsation.

One who counterfeits folly; a professional jester or buffoon;
   a retainer formerly kept to make sport, dressed fantastically in
   motley, with ridiculous accouterments.

Indicating the antecedent cause or occasion of an action;
   the motive or inducement accompanying and prompting to an act or state;
   the reason of anything; that on account of which a thing is or is done.

Indicating the remoter and indirect object of an act; the
   end or final cause with reference to which anything is, acts, serves,
   or is done.

One who takes, or that which is said on, the affrimative side;
   that which is said in favor of some one or something; -- the antithesis
   of against, and commonly used in connection with it.

Strength or energy of body or mind; active power; vigor;
   might; often, an unusual degree of strength or energy; capacity of
   exercising an influence or producing an effect; especially, power to
   persuade, or convince, or impose obligation; pertinency; validity;
   special signification; as, the force of an appeal, an argument, a
   contract, or a term.

Advanced, as compared with something else; toward the
   front; being or coming first, in time, place, order, or importance;
   preceding; anterior; antecedent; earlier; forward; -- opposed to back
   or behind; as, the fore part of a garment; the fore part of the day;
   the fore and of a wagon.

To relinquish the enjoyment or advantage of; to give up;
   to resign; to renounce; -- said of a thing already enjoyed, or of one
   within reach, or anticipated.

Belonging to courts of judicature or to public discussion
   and debate; used in legal proceedings, or in public discussions;
   argumentative; rhetorical; as, forensic eloquence or disputes.

To lose the remembrance of; to let go from the memory;
   to cease to have in mind; not to think of; also, to lose the power of;
   to cease from doing.

One of the parts into which anything is furcated or divided;
   a prong; a branch of a stream, a road, etc.; a barbed point, as of an
   arrow.

Devoted to, or done in accordance with, forms or rules;
   punctilious; regular; orderly; methodical; of a prescribed form; exact;
   prim; stiff; ceremonious; as, a man formal in his dress, his gait, his
   conversation.

The manner in which a thing is formed; structure;
   construction; conformation; form; as, the peculiar formation of the
   heart.

Mineral deposits and rock masses designated with
   reference to their origin; as, the siliceous formation about geysers;
   alluvial formations; marine formations.

Exciting fear or apprehension; impressing dread;
   adapted to excite fear and deter from approach, encounter, or
   undertaking; alarming.

One of forty equal parts into which one whole is divided;
   the quotient of a unit divided by forty; one next in order after the
   thirty-ninth.

To help onward; to advance; to promote; to accelerate;
   to quicken; to hasten; as, to forward the growth of a plant; to forward
   one in improvement.

A state of advance beyond the usual degree;
   prematureness; precocity; as, the forwardnessof spring or of corn; the
   forwardness of a pupil.

A person whose views and opinions are extremely antiquated;
   one whose sympathies are with a former time rather than with the
   present.

Not favorable; unpropitious; not fair or advantageous;
   as, a foul wind; a foul road; cloudy or rainy; stormy; not fair; --
   said of the weather, sky, etc.

Not conformed to the established rules and customs of a
   game, conflict, test, etc.; unfair; dishonest; dishonorable; cheating;
   as, foul play.

Consisting of four horses controlled by one person;
   as, a four-in-hand team; drawn by four horses driven by one person; as,
   a four-in-hand coach.

Any domesticated bird used as food, as a hen, turkey, duck;
   in a more restricted sense, the common domestic cock or hen (Gallus
   domesticus).

The condition quality of being frail, physically,
   mentally, or morally, frailness; infirmity; weakness of resolution;
   liableness to be deceived or seduced.

A term applied, especially in England, to certain machines
   built upon or within framework; as, a stocking frame; lace frame;
   spinning frame, etc.

Invested with a particular freedom or franchise;
   enjoying certain immunities or privileges; admitted to special rights;
   -- followed by of.

Not united or combined with anything else; separated;
   dissevered; unattached; at liberty to escape; as, free carbonic acid
   gas; free cells.

Any violent agitation of the mind approaching to
   distraction; violent and temporary derangement of the mental faculties;
   madness; rage.

Lately produced, gathered, or prepared for market; not
   stale; not dried or preserved; not wilted, faded, or tainted; in good
   condition; as, fresh vegetables, flowers, eggs, meat, fruit, etc.;
   recently made or obtained; occurring again; repeated; as, a fresh
   supply of goods; fresh tea, raisins, etc.; lately come or made public;
   as, fresh news; recently taken from a well or spring; as, fresh water.

Renewed in vigor, alacrity, or readiness for action; as,
   fresh for a combat; hence, tending to renew in vigor; rather strong;
   cool or brisk; as, a fresh wind.

In a fresh manner; vigorously; newly, recently;
   brightly; briskly; coolly; as, freshly gathered; freshly painted; the
   wind blows freshly.

To rub; to wear away by friction; to chafe; to gall;
   hence, to eat away; to gnaw; as, to fret cloth; to fret a piece of gold
   or other metal; a worm frets the plants of a ship.

Agitation of mind marked by complaint and impatience;
   disturbance of temper; irritation; as, he keeps his mind in a continual
   fret.

Full of that which causes fright; exciting alarm;
   impressing terror; shocking; as, a frightful chasm, or tempest; a
   frightful appearance.

Wanting warmth, fervor, ardor, fire, vivacity, etc.;
   unfeeling; forbidding in manner; dull and unanimated; stiff and formal;
   as, a frigid constitution; a frigid style; a frigid look or manner;
   frigid obedience or service.

Covered with hoarfrost or anything resembling hoarfrost;
   ornamented with frosting; also, frost-bitten; as, a frosted cake;
   frosted glass.

Productive of no advantage or good effect; vain; idle;
   useless; unprofitable; as, a fruitless attempt; a fruitless
   controversy.

Not fixed; not durable; liable to disappear or fall away;
   volatile; uncertain; evanescent; liable to fade; -- applied to material
   and immaterial things; as, fugitive colors; a fugitive idea.

Not wanting in any essential quality; complete, entire;
   perfect; adequate; as, a full narrative; a person of full age; a full
   stop; a full face; the full moon.

Quite; to the same degree; without abatement or diminution;
   with the whole force or effect; thoroughly; completely; exactly;
   entirely.

To utter or send out with denunciations or censures;
   -- said especially of menaces or censures uttered by ecclesiastical
   authority.

Pertaining to fulmination; detonating; specifically
   (Chem.), pertaining to, derived from, or denoting, an acid, so called;
   as, fulminic acid.

A passage or avenue for a fluid or flowing substance;
   specifically, a smoke flue or pipe; the iron chimney of a steamship or
   the like.

A thorny evergreen shrub (Ulex Europaeus), with beautiful
   yellow flowers, very common upon the plains and hills of Great Britain;
   -- called also gorse, and whin. The dwarf furze is Ulex nanus.
